import React from 'react';

const Alphabet: React.FC = () => {
  const alphabet = Array.from(Array(26), (_, i) => String.fromCharCode(65 + i)); // Generate an array of alphabet characters

  return (
    <div className="alphabet">
      {alphabet.map((char) => (
        <button key={char} className="btn btn-primary m-2">
          {char}
        </button>
      ))}
    </div>
  );
};

export default Alphabet;
